import os
from flask import Flask, request, Response, g, render_template, jsonify
from vertexai.preview.generative_models import GenerativeModel, Part
import base64


app = Flask(__name__)
app.debug = True

@app.route('/chat', methods=['POST'])
def generate():
  model = GenerativeModel("gemini-pro-vision")
  responses = model.generate_content(
    [image1, """Extract the items and prices from a fish market photo and output them in JSON."""],
    generation_config={
        "max_output_tokens": 2048,
        "temperature": 0.4,
        "top_p": 1,
        "top_k": 32
    },
    stream=True,
  )

  for response in responses:
    return jsonify(response.text)

image1 = Part.from_data(data=base64.b64decode(""""""), mime_type="image/png")

if __name__ == '__main__':
    app.run(debug=True, host="0.0.0.0", port=int(os.environ.get("PORT", 8080)))